// app/javascript/packs/application.js

import React from 'react';
import ReactDOM from 'react-dom';

document.addEventListener('DOMContentLoaded', () => {
  const startCapturePage = () => {
    window.location.href = '/license_data/capture';
  };

  const startDisplayPage = () => {
    window.location.href = '/license_data/display';
  };

  document.getElementById('captureButton').addEventListener('click', startCapturePage);
  document.getElementById('displayButton').addEventListener('click', startDisplayPage);
});
